  false,\n\t\"url\": null,\n\t\"notes\": \" Hospitals in New Mexico The term \"hospital\"
  ... means an institution which-n                (1) is primarily engaged in providing,
  by or under the supervision of physicians, ton                inpatients > (A) diagnostic
  services and therapeutic services for medicaln                diagnosis, treatment,
  and care of injured, disabled, or sick persons, or > (B)n                rehabilitation
  services for the rehabilitation of injured, disabled, or sickn                persons;
  (...) (5) provides 24-hour nursing service rendered or supervised by an                registered
  professional nurse, and has a licensed practical nurse or registeredn                professional
  nurse on duty at all times; ... (...) (7) in the case of an institutionn                in
  any State in which State or applicable local law provides for the licensing ofn
  \               hospitals, > (A) is licensed pursuant to such law or > (B) is approved,
  by then                agency of such State or locality responsible for licensing
  hospitals, as meeting then                standards established for such licensing;
  (Excerpt from Title XVIII of the Socialn                Security Act [42 U.S.C.
  u00a7 1395x(e)],n                http://www4.law.cornell.edu/uscode/html/uscode42/usc_sec_42_00001395---x000-.html)n
  \               Included in this dataset are General Medical and Surgical Hospitals,
  Psychiatric andn                Substance Abuse Hospitals, and Specialty Hospitals
  (e.g., Children's Hospitals,n                Cancer Hospitals, Maternity Hospitals,
  Rehabilitation Hospitals, etc.). TGS has maden                a concerted effort
  to include all general medical/surgical hospitals in New Mexico.n                Other
  types of hospitals are included if they were represented in datasets sent byn                the
  state. Therefore, not all of the specialty hospitals in New Mexico aren                represented
  in this dataset. Hospitals operated by the Veterans Administration (VA)n                are
  included, even if the state they are located in does not license VA Hospitals.n
  \               Nursing homes and Urgent Care facilities are excluded because they
  are included in an                separate dataset. Locations that are administrative
  offices only are excluded fromn                the dataset. Records with \"-DOD\"
  appended to the end of the [NAME] value are locatedn                on a military
  base, as defined by the Defense Installation Spatial Datan                Infrastructure
  (DISDI) military installations and military range boundaries. Textn                fields
  in this dataset have been set to all upper case to facilitate consistentn                database
  engine search results. All diacritics (e.g., the German umlaut or then                Spanish
  tilde) have been replaced with their closest equivalent English character ton                facilitate
  use with database systems that may not support diacritics. Then                currentness
  of this dataset is indicated by the [CONTDATE] field. Based upon thisn                field,
  the oldest record dates from 06/16/2008 and the newest record dates fromn                06/27/2008
